import React, { Component } from "react";
import "./Contact.scss";

class App extends Component {
  render() {
    return (
      <section className="intro_section">
        <div className="introbox">
          <h1 className="introbox_name"></h1>
        </div>
      </section>
    );
  }
}
export default App;
